    amendments have been filed for the August Monthly report to show that the donations
    to Bachmann for Congress should have been split $4000 for Primary and $1000 for
    General and the April Monthly has been amended to show that the contribution to
    David McSweeney for Congress was for Primary Debt Retirement.  Also, please note
    that all disbursements for Fundraising Consultant Fees and Catering Costs (SEE
    MEMOS) were for the benefit of the Committee and not for any specific candidates."
